import React, { useState } from 'react';
import '../style/SoundPage.css';

export default function MusicInsights() {
  const [audioFeatureRows, setAudioFeatureRows] = useState([]);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  // Input values for audio features
  const [instrumentalness, setInstrumentalness] = useState(0);
  const [energy, setEnergy] = useState(0);
  const [valence, setValence] = useState(0);
  const [liveness, setLiveness] = useState(0);
  const [acousticness, setAcousticness] = useState(0);

  const fetchSongsByAudioFeatures = async () => {
    setLoading(true);
    setError("");
    setAudioFeatureRows([]);
    try {
      // Build query string
      const params = new URLSearchParams({
        instrumentalness,
        energy,
        valence,
        liveness,
        acousticness,
      }).toString();

      console.log(`Fetching data with params: ${params}`);

      // Fetch data from backend
      const response = await fetch(`http://localhost:8080/songs/audio-features?${params}`);
      if (!response.ok) {
        throw new Error(`Failed to fetch audio features. Status: ${response.status}`);
      }

      // Parse JSON response
      const data = await response.json();
      console.log("API Response Data:", data);

      if (data.length === 0) {
        setError("No songs found matching the criteria.");
      } else {
        setAudioFeatureRows(data);
      }
    } catch (err) {
      console.error("Error fetching audio features:", err);
      setError("Failed to fetch songs. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div id="sound-page-wrapper">
      <h1>Track Explorer</h1>
      <div className="controls">
        <label>Instrumentalness: </label>
        <input
          type="number"
          value={instrumentalness}
          onChange={(e) => setInstrumentalness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Energy: </label>
        <input
          type="number"
          value={energy}
          onChange={(e) => setEnergy(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Valence: </label>
        <input
          type="number"
          value={valence}
          onChange={(e) => setValence(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Liveness: </label>
        <input
          type="number"
          value={liveness}
          onChange={(e) => setLiveness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Acousticness: </label>
        <input
          type="number"
          value={acousticness}
          onChange={(e) => setAcousticness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <button onClick={fetchSongsByAudioFeatures}>Search</button>
      </div>

      {loading && <div className="loading-message">Loading...</div>}
      {error && <div className="error-message">{error}</div>}

      {!loading && audioFeatureRows.length > 0 && (
        <table className="data-table">
          <thead>
            <tr>
              <th>Track Title</th>
              <th>Instrumentalness</th>
              <th>Energy</th>
              <th>Valence</th>
              <th>Liveness</th>
              <th>Acousticness</th>
            </tr>
          </thead>
          <tbody>
            {audioFeatureRows.map((row, index) => (
              <tr key={index}>
                <td>{row.title || "Unknown Title"}</td>
                <td>{row.instrumentalness?.toFixed(3) || "N/A"}</td>
                <td>{row.energy?.toFixed(3) || "N/A"}</td>
                <td>{row.valence?.toFixed(3) || "N/A"}</td>
                <td>{row.liveness?.toFixed(3) || "N/A"}</td>
                <td>{row.acousticness?.toFixed(3) || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
